    "Advanced Manufacturing Technologies (AMT): 3D Print Element",nt"tracking_summary":
    {ntt"total": 49,ntt"recent": 6nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:24:55.033990",nt"name": "advanced-manufacturing-technologies-amt-3d-print-element",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;MIS, Inc., under SBIR Phase III
    contract with NASA, will build a 3D printer that can build objects out of plastic
    feedstock. NASA will provide insight to ensure that the design and materials meet
    flight certification (safety, interfaces, and operability) requirements as well
    as performing qualification and performance testing. The 3D Print payload will demonstrate
    melt deposition modeling additive manufacturing in a consistent microgravity environment.
    Lessons learned from this technology demonstration will be incorporated into future
    generations of advanced manufacturing technology for space applications.&lt;/p&gt;",nt"license_title":
